You can get the pose of a tag from the april tag field layout in the swerve subsytem

Optional tagPoseOpt3d = aprilTagFieldLayout.getTagPose(closesttag); if (tagPoseOpt3d.isPresent()) tagPose2d = tagPoseOpt3d.get().toPose2d();

Then apply whatever offsets you want to get a final pose by setting up a Transform2d and then tagPose2d.transformBy(your Transform2d)

The values you have in code are not the same as the tag pose so you must be offsetting them xoffset, yoffset, angleoffset.

Get the nearest tag pose from the field layout. Transform2d tr2d= new Transform2d(xoffset, yoffset, new Rotation2d(Units.degreesToRadians(angle offset)));

Pose2d targetPose = tagpose2d.transformBy(tr2d); Then driveToPose(targetPose) covers all tags
